import{_ as e,o as a,c as o,a9 as r}from"./chunks/framework.DJOAND2c.js";const S=JSON.parse('{"title":"Character Encodings in JSSC","description":"","frontmatter":{},"headers":[],"relativePath":"internals/encodings/index.md","filePath":"internals/encodings/index.md","lastUpdated":1769872397000}'),s={name:"internals/encodings/index.md"};function i(t,n,c,d,l,g){return a(),o("div",null,[...n[0]||(n[0]=[r('<h1 id="character-encodings-in-jssc" tabindex="-1">Character Encodings in JSSC <a class="header-anchor" href="#character-encodings-in-jssc" aria-label="Permalink to &quot;Character Encodings in JSSC&quot;">​</a></h1><p>JSSC uses its own <strong>internal character encodings</strong> as part of the compression algorithm.</p><p>These encodings are <strong>not related</strong> to ASCII, UTF‑8, UTF‑16, Windows‑125x, ISO‑8859, or any other system or platform encoding.</p><p>They exist <strong>only inside JSSC</strong> and are used to optimize compression for many languages, primarily the most widely used ones.</p><p>Character Encodings are used by <a href="./../modes/05"><strong>Compression Mode <code>05</code> — “Character Encoding”</strong></a>. There are <strong>15 Character Encodings</strong> covering <strong>23 languages</strong>.</p><h2 id="list-of-jssc-character-encodings" tabindex="-1">List of JSSC Character Encodings <a class="header-anchor" href="#list-of-jssc-character-encodings" aria-label="Permalink to &quot;List of JSSC Character Encodings&quot;">​</a></h2><ul><li><a href="./base"><code>00</code> <strong>JSSCBASE</strong></a> — No languages - Punctuation, numbers, currencies, and symbols</li><li><a href="./ru"><code>01</code> <strong>JSSCRU</strong></a> — Russian, Ukrainian, Belarusian, Kazakh</li><li><a href="./enru"><code>02</code> <strong>JSSCENRU</strong></a> — English, Russian, Ukrainian, Belarusian</li><li><a href="./enkk"><code>03</code> <strong>JSSCENKK</strong></a> — English, Russian, Kazakh</li><li><a href="./hi"><code>04</code> <strong>JSSCHI</strong></a> — Hindi</li><li><a href="./enhi"><code>05</code> <strong>JSSCENHI</strong></a> — English, Hindi</li><li><a href="./bn"><code>06</code> <strong>JSSCBN</strong></a> — Bengali</li><li><a href="./enbn"><code>07</code> <strong>JSSCENBN</strong></a> — English, Bengali</li><li><a href="./hibn"><code>08</code> <strong>JSSCHIBN</strong></a> — Hindi, Bengali</li><li><a href="./ja"><code>09</code> <strong>JSSCJA</strong></a> — English, Japanese (Hiragana and Katakana)</li><li><a href="./telu"><code>10</code> <strong>JSSCTelu</strong></a> — English, Telugu</li><li><a href="./mr"><code>11</code> <strong>JSSCMR</strong></a> — English, Marathi</li><li><a href="./b"><code>12</code> <strong>JSSCB</strong></a> — <em>“Baltic”</em> - Latvian, Lithuanian, Estonian, Polish, Czech, Slovak</li><li><a href="./e"><code>13</code> <strong>JSSCE</strong></a> — <em>“European”</em> - English, French, German, Spanish, Portuguese, Italian, Dutch</li><li><a href="./ar"><code>14</code> <strong>JSSCAR</strong></a> — Arabic</li></ul>',7)])])}const u=e(s,[["render",i]]);export{S as __pageData,u as default};
